pragma solidity ^0.5.0;

/// @title An Election testing platform
/// @author WG
/// @notice This is for testing only

contract Election {

    address public bossman;

    struct Candidate {
        uint id;
        string name;
        uint voteCount;
    }

    struct Voter {
        address delegate;
        bool voted;
        uint weight;
        uint vote;
    }

    mapping(address => Voter) public voters;

    constructor () public {
        bossman = msg.sender;
        voters[bossman].weight = 1;
    }

    modifier onlyBoss() {
        require(msg.sender == bossman);
        _;
    }

    function returnAddress() public returns (address){
        return msg.sender;
    }
/*
    function returnBalance() public {
        return msg.sender.balance();
    }

    function returnInfo() public onlyBoss {

    }
*/
    function kill() public onlyBoss {
        selfdestruct(msg.sender);
    }
}

